    def createNodesList_kmer(self):
        
        for i in self.reads:
            for kmer_index in range(len(i)-self.kmer_len+1): # Creating edges of kmer length
                edge = i[kmer_index:kmer_index + self.kmer_len]
                
                
                if edge not in self.edges_dict:
                    self.edges_dict[edge] = Edge(edge)
                    
                edge_object = self.edges_dict[edge]
                edge_object.coverage += 1      
                
                edge_prefix = edge[:-1]
                edge_suffix = edge[1:]                                                    
                self.nodes_dict.setdefault(edge_prefix, Nodes(edge_prefix)) # creating nodes dict from edges prefix and suffix
                self.nodes_dict.setdefault(edge_suffix, Nodes(edge_suffix))
                
    def buildDeBruijnGraph(self): # Creating adjacency list and noting the in/out degree, Also recording nodes with multiple in/out degree for bubble removal
        
        for edge in self.edges_dict:
            prefix_node = edge[:-1]
            suffix_node = edge[1:]
            
            prefix_obj = self.nodes_dict[prefix_node]
            suffix_obj = self.nodes_dict[suffix_node]
            
            if prefix_node != suffix_node: # because self loop of length 1 is not allowed
                if suffix_node not in prefix_obj.neighbors: # because in the de-bruijn graph edges should be added only once
                    prefix_obj.neighbors.append(suffix_node)
                    suffix_obj.previous_nodes.append(prefix_node)
                    prefix_obj.out_degree += 1 # creating out-degree for out node
                    suffix_obj.in_degree += 1
                
                if prefix_obj.out_degree > 1: self.multiple_outdegree.add(prefix_node) # Storing nodes with > 1 in_degree
                if suffix_obj.in_degree > 1: self.multiple_indegree.add(suffix_node)        

