    def removeTips(self):
        for key in self.nodes_dict.copy(): # Creating copy of dict because dict elements cannot be
            # removed while iterating over it because it changes the length
            if key in self.nodes_dict: # To avoid error because the deleted node in nodes_dict is 
                # still present in nodes_dict.copy() but it should not be considered
                node = self.nodes_dict[key]
                if node.out_degree == 1 and node.in_degree == 0: # Nodes with no incoming edge
                    self.edges_removed += 1
                    self.nodes_dict.pop(key) # removing the tip end node from nodes list
                    
                    new_key = node.neighbors.pop() 
                    previous_node_key = key                    
                    tip_end_node, last_node_removed = self.tipWithNoIncomingNode(new_key, previous_node_key) # Sending the next node to remove  
                    
                    # Adjusting the in/out degree of the tip start node
                    self.nodes_dict[tip_end_node].previous_nodes.remove(last_node_removed)
                    self.nodes_dict[tip_end_node].in_degree -= 1
                    
                if node.out_degree == 0 and node.in_degree == 1: # Nodes with no outgoing edge
                    self.edges_removed += 1
                    self.nodes_dict.pop(key) # removing the tip end node from nodes list
                    
                    new_key = node.previous_nodes.pop()
                    next_node_key = key                    
                    tip_start_node, last_node_removed = self.tipWithNoOutgoingNode(new_key, next_node_key) # Sending the previous node to remove
                    
                    # Adjusting the in/out degree of the tip start node
                    self.nodes_dict[tip_start_node].neighbors.remove(last_node_removed)
                    self.nodes_dict[tip_start_node].out_degree -= 1              
                
    def tipWithNoIncomingNode(self, key, previous_node_key):
        current_node = self.nodes_dict[key]
        if(current_node.in_degree == 1 and current_node.out_degree == 1):
            self.edges_removed += 1 
            self.nodes_dict.pop(key)
            
            new_key = current_node.neighbors.pop()
            previous_node_key = key                       
            tip_end_node, last_node_removed = self.tipWithNoIncomingNode(new_key, previous_node_key)
            return tip_end_node, last_node_removed
        else:
            return key, previous_node_key
            
    def tipWithNoOutgoingNode(self, key, next_node_key):
        current_node = self.nodes_dict[key]
        if(current_node.out_degree == 1 and current_node.in_degree == 1):
            self.edges_removed += 1
            self.nodes_dict.pop(key)
            
            new_key = current_node.previous_nodes.pop()
            next_node_key = key            
            tip_start_node, last_node_removed = self.tipWithNoOutgoingNode(new_key, next_node_key)
            return tip_start_node, last_node_removed
        else:
            return key, next_node_key
                  
